function Home(props){
  const [brand, setBrand] = useState({});
  const [cf,setCF] = useState('');

  useEffect(() => {
    for(let i = 0; i<makeupData.length;i++){
        setBrand(makeupData[i]);
    }
  },[]);
  return (
    <div>
        <h1>{brand.brand}</h1>
    </div>
  );
}
